import {User} from "../../types/User";

const AdminList = (props: any) => {
  const users: Array<User> = props.users;

  const onUserDeleteHandler = () => {
    console.log("DELETE!")
  }

  const usersList = users.map((us: User) =>
    (<>
      <div>us.username</div>
      <div>us.userLevel</div>
      <button type="button" onClick={onUserDeleteHandler}>Delete user</button>
    </>)
  )
  return (
    <ul>
      <div>usersList</div>
    </ul>
  );

}

export default AdminList;
